  ticket_text58: '–í–Ω–µ—Å—ñ—Ç—å –º–æ–Ω–µ—Ç–∏ ¬´FLOW¬ª —É Blocto, –≥–∞–º–∞–Ω–µ—Ü—å Flow –∞–±–æ –ø—Ä–∏–¥–±–∞–π—Ç–µ –º–æ–Ω–µ—Ç–∏ ¬´FLOW¬ª —É –¥–æ–¥–∞—Ç–∫—É Blocto –∑–∞ –¥–æ–ø–æ–º–æ–≥–æ—é MoonPay.',
  ticket_text59: '–°–ø–æ—á–∞—Ç–∫—É —Å—Ç–≤–æ—Ä—ñ—Ç—å –∫–≤–∏—Ç–æ–∫. –í–∏–±–µ—Ä—ñ—Ç—å ¬´–°—Ç–≤–æ—Ä–∏—Ç–∏ –∑–∞—è–≤–∫—É¬ª –≤ –º–µ–Ω—é —É –≤–µ—Ä—Ö–Ω—å–æ–º—É –ø—Ä–∞–≤–æ–º—É –∫—É—Ç—ñ.',
