  ticket_text61: '–¢—É—Ç –≤–∏ –ø–ª–∞—Ç–∏—Ç–µ 0,3 "FLOW", –∞–ª–µ –Ω–µ —Ö–≤–∏–ª—é–π—Ç–µ—Å—è. –¶–µ —î–¥–∏–Ω–µ –º—ñ—Å—Ü–µ, –¥–µ –º–æ–∂–Ω–∞ –ø–ª–∞—Ç–∏—Ç–∏. –ü–æ—Ç—ñ–º –≤–∏ –º–æ–∂–µ—Ç–µ –≤–∏–∫–æ—Ä–∏—Å—Ç–æ–≤—É–≤–∞—Ç–∏ —Ü—é –≤–µ–±-–∞–¥—Ä–µ—Å—É –¥–ª—è –≤–∏–ø—É—Å–∫—É –Ω–µ–æ–±–º–µ–∂–µ–Ω–æ—ó –∫—ñ–ª—å–∫–æ—Å—Ç—ñ –∫–≤–∏—Ç–∫—ñ–≤. (–ö—Ä–∞—É–¥—Ñ–∞–Ω–¥–∏–Ω–≥ —Ç–∞–∫–æ–∂ –≤–∫–ª—é—á–µ–Ω–∏–π)',
  ticket_text62: '–ü—ñ—Å–ª—è —Ç–æ–≥–æ, —è–∫ –º–∏–Ω–µ –æ–¥–∏–Ω –¥–µ–Ω—å, –∫–≤–∏—Ç–∫–∏ –º–æ–∂–Ω–∞ –æ—Ñ–æ—Ä–º–∏—Ç–∏. –ü—Ä–∏ —Ü—å–æ–º—É –º–æ–∂–Ω–∞ –Ω–∞–ª–∞—à—Ç—É–≤–∞—Ç–∏ –∫—Ä–∞—É–¥—Ñ–∞–Ω–¥–∏–Ω–≥.',
