  ticket_text64: '–ó‚Äô—è–≤–∏—Ç—å—Å—è –∫–Ω–æ–ø–∫–∞ –∫–æ–ø—ñ—é–≤–∞–Ω–Ω—è URL-–∞–¥—Ä–µ—Å–∏. –°–∫–æ–ø—ñ—é–π—Ç–µ –π–æ–≥–æ —Ç–∞ –ø–æ—à–∏—Ä—Ç–µ —ñ–Ω—Ñ–æ—Ä–º–∞—Ü—ñ—é –≤ —Å–æ—Ü—ñ–∞–ª—å–Ω–∏—Ö –º–µ—Ä–µ–∂–∞—Ö, —â–æ–± –±–∞–≥–∞—Ç–æ –ª—é–¥–µ–π –º–æ–≥–ª–∏ –∫—É–ø–∏—Ç–∏ –∫–≤–∏—Ç–∫–∏.',
