  ticket_text68: '–û—Å–æ–±–∞, —è–∫–∞ –≤–∏–∫–æ—Ä–∏—Å—Ç–æ–≤—É—î –∫–≤–∏—Ç–æ–∫, –æ—Ç—Ä–∏–º—É—î —ñ–Ω—Ñ–æ—Ä–º–∞—Ü—ñ—é –ø—Ä–æ –ø–æ–¥—ñ—é, –∑–∞–ø—Ä–æ–ø–æ–Ω–æ–≤–∞–Ω—É –æ—Ä–≥–∞–Ω—ñ–∑–∞—Ç–æ—Ä–æ–º. –¶–µ –º–æ–∂–µ –±—É—Ç–∏ –∫–æ–¥ –∑–∞–ø—Ä–æ—à–µ–Ω–Ω—è Zoom –∞–±–æ –±—É–¥—å-—è–∫–∞ —ñ–Ω—Ñ–æ—Ä–º–∞—Ü—ñ—è.',
