  ticket_text70: '–ü—ñ—Å–ª—è —Ç–æ–≥–æ, —è–∫ –≤—ñ–¥—à–∫–æ–¥—É–≤–∞–Ω–Ω—è –±—É–¥–µ –∑–¥—ñ–π—Å–Ω–µ–Ω–æ, –≥–∞–º–∞–Ω–µ—Ü—å –∫–ª—ñ—î–Ω—Ç–∞ –∑–º–æ–∂–µ –ø–æ–±–∞—á–∏—Ç–∏ –±–∞–ª–∞–Ω—Å, –≤–∫–ª—é—á–∞—é—á–∏ –ø–æ–≤–µ—Ä–Ω—É—Ç—É —Å—É–º—É, –ø—Ä–æ—Ç—è–≥–æ–º –∫—ñ–ª—å–∫–æ—Ö –¥–µ—Å—è—Ç–∫—ñ–≤ —Å–µ–∫—É–Ω–¥.',
  ticket_text71: '–©–æ–± –∑–¥—ñ–π—Å–Ω–∏—Ç–∏ –≤—ñ–¥—à–∫–æ–¥—É–≤–∞–Ω–Ω—è, –∫–ª—ñ—î–Ω—Ç –ø–æ–≤–∏–Ω–µ–Ω –Ω–∞–ª–∞—à—Ç—É–≤–∞—Ç–∏ –≤—ñ–¥—à–∫–æ–¥—É–≤–∞–Ω–Ω—è –ª–∏—à–µ –æ–¥–∏–Ω —Ä–∞–∑, –≤–∏–±—Ä–∞–≤—à–∏ –ù–∞–ª–∞—à—Ç—É–≤–∞–Ω–Ω—è –≤ –º–µ–Ω—é —É –≤–µ—Ä—Ö–Ω—å–æ–º—É –ø—Ä–∞–≤–æ–º—É –∫—É—Ç—ñ.',
  ticket_text72: '–ö–ª—ñ—î–Ω—Ç–∏ –º–æ–∂—É—Ç—å –∫—É–ø—É–≤–∞—Ç–∏ –º–æ–Ω–µ—Ç–∏ FLOW –∑–∞ –¥–æ–ø–æ–º–æ–≥–æ—é –∫—Ä–µ–¥–∏—Ç–Ω–æ—ó –∫–∞—Ä—Ç–∫–∏ –≤ –¥–æ–¥–∞—Ç–∫—É Blocto. –ü–æ—Ç—ñ–º –º–æ–Ω–µ—Ç–∏ –≤–∏–∫–æ—Ä–∏—Å—Ç–æ–≤—É—é—Ç—å—Å—è –¥–ª—è –ø—ñ–¥—Ç—Ä–∏–º–∫–∏ –≤–∞—à–æ–≥–æ –±—ñ–∑–Ω–µ—Å—É.',
