  operation_text123: '–©–æ–± –Ω–∞–ª–∞—à—Ç—É–≤–∞—Ç–∏ –ø–∞—Ä–∞–º–µ—Ç—Ä–∏, –≤–∞–º –ø–æ—Ç—Ä—ñ–±–Ω–æ –ø—ñ–¥–∫–ª—é—á–∏—Ç–∏—Å—è –¥–æ –≥–∞–º–∞–Ω—Ü—è, —Ç–æ–º—É –Ω–∞—Ç–∏—Å–Ω—ñ—Ç—å –∫–Ω–æ–ø–∫—É ¬´–ö–æ—Ä–∏—Å—Ç—É–≤–∞—á¬ª —É –º–µ–Ω—é –≤–∏—â–µ.',
  operation_text124: '–¶–µ–π –ø–∞—Ä–∞–º–µ—Ç—Ä –ø—Ä–∏–∑–Ω–∞—á–µ–Ω–∏–π –¥–ª—è –ª—é–¥–µ–π, —è–∫—ñ —Ö–æ—á–∞ –± —Ä–∞–∑ –∫–æ—Ä–∏—Å—Ç—É–≤–∞–ª–∏—Å—è —Ü–∏–º —Å–µ—Ä–≤—ñ—Å–æ–º. –Ø–∫—â–æ –≤–∏ –Ω—ñ–∫–æ–ª–∏ —Ä–∞–Ω—ñ—à–µ –Ω–µ –∫–æ—Ä–∏—Å—Ç—É–≤–∞–ª–∏—Å—è –ø–æ—Å–ª—É–≥–æ—é, –≤–∏ –Ω–µ –º–æ–∂–µ—Ç–µ –ø—Ä–æ–¥–æ–≤–∂–∏—Ç–∏.',
  operation_text125: '–í–≤–µ–¥—ñ—Ç—å —ñ–Ω—Ñ–æ—Ä–º–∞—Ü—ñ—é, —è–∫—É –ø–æ—Ç—Ä—ñ–±–Ω–æ –≤—ñ–¥–æ–±—Ä–∞–∑–∏—Ç–∏ –Ω–∞ –µ–∫—Ä–∞–Ω—ñ –∫–ª—ñ—î–Ω—Ç–∞, —è–∫–∏–π —Å–∫–æ—Ä–∏—Å—Ç–∞–≤—Å—è –∫–≤–∏—Ç–∫–æ–º. –¶—è —ñ–Ω—Ñ–æ—Ä–º–∞—Ü—ñ—è –Ω–∞–¥–∞—î—Ç—å—Å—è —è–∫ –ö–û–î —ñ –≤–∏–∫–æ—Ä–∏—Å—Ç–æ–≤—É—î—Ç—å—Å—è –¥–ª—è –ø—Ä–∏—î–¥–Ω–∞–Ω–Ω—è –¥–æ –ø–æ–¥—ñ—ó.',
